INSERT INTO `mission` (`id`, `code`, `topic`, `content`, `number_of_people`, `day1_condition`, `day2_condition`, `day3_condition`, `day4_condition`)
VALUES
	(1,'YEyKd','灌籃高手','６人輪流投籃，在３分鐘內投進較多籃球的隊伍即可佔領此部落。','6','165以下x4','戴眼鏡x4','拿IPHONEx5','反手可摸到肚臍x2'),
	(11,'DWVw4','乒乓傳情','桌上有5個紙杯，你們必須把乒乓球放在第一個水杯的水面上後，將乒乓球從第一個紙杯吹到最後一個紙杯，第一位隊員吹完後下一位隊員才可以吹第二輪。花較少秒數吹完三輪即可佔領此部落。','3','耳垂連起來x1','有瀏海x3','RDAAx2','紮衣服x3'),
	(21,'soDJ3','Flip-Flop','每人會有一個裝滿水的水杯，須將水杯內的水喝完後，用一根手指將杯口翻至下。前一位隊員喝完水、翻杯子成功後，下一位隊員才可進行遊戲。花費時間比上一陣營少即可佔領此部落。','6','3男3女','SAAx3+AAx2+MAAx1','穿黑襪x2','鞋子有藍色x3'),
	(31,'GJPzb','呼啦抓小雞','同一小隊的隊員搭肩排成縱列，兩隊的排頭手拿呼拉圈，想辦法把呼拉圈套到敵隊的最後一個人身上，率先套中敵隊的隊伍即可獲勝！ 此遊戲採三戰兩勝制，先獲勝兩次的陣營可以佔領此部落。','5','外雙眼皮x2','穿帆布鞋x1+擦唇膏x1','175以上x1','有白頭髮x2'),
	(41,'lJAfD','頭好撞撞','一隊一回合派出四人上場，用頭進行三回合的排球對戰。先猜拳決定發球方，發球者在線外把球拋起並用頭把球頂到敵方，雙方用頭擊的方式互打，球在敵方落地或是敵方將球擊出界則己方得分．先得七分者拿下該回合勝利。率先獲得兩回合勝利的隊伍即可佔領部落！','12','穿耳洞x4','沒瀏海x6','單眼皮x4','用安卓手機x8'),
	(51,'SZ1yG','打水瓢','一次派出一位隊員挑戰打水瓢，每人有３次機會，連續次數比上一陣營高即可佔領此部落','4','3男1女','170公分以下男生x2','穿全白素Tx2','拳頭可放進嘴巴裡x1'),
	(61,'y997V','巧拼渡河','小隊全體人員站在7片巧拼上，身體不可超出巧拼之外，隊伍最後一人須將最後一塊巧拼傳至隊伍前方，並以此慢慢往前進，直到全員接通過終點線。過程中雙腳都必須站在巧拼上，不可單腳站立也不可透過巧拼滑行前進，違規一次就要被扣一塊巧拼。花費時間比上一陣營少即可佔領此部落。','8','170公分以上x3+155公分以下x2','捲髮女生x3+直髮女生x2','戴手鍊x2+戴手錶x4','單眼皮x3+雙眼皮x3'),
	(71,'X02aw','撲克牌好手','在桌上反蓋的16張撲克牌當中，將所有數字兩兩相同的撲克牌找出來。一次派出一人翻開兩張反蓋的撲克牌，若兩張牌不相同，則需念完指定文章才可以換人並進行下一次翻牌。花較少時間找出所有成對撲克牌者可佔領此部落！','4','1男3女','170公分以上x4','戴眼鏡x4','頭髮過肩x4'),
	(81,'Glsx3','斷開魂結','所有人把手牽起來圍成一個圓，不可牽左右相鄰的人、不可兩手都牽同一個人。確定全部人都將手牽起來後，盡快在手不放開的狀況下把打結的圓解開成為一個圓，秒數少即可佔領部落！','12','6男6女','穿白鞋x5','染頭髮x6','單眼皮x5'),
	(91,'YNbMr','拍拍羽毛球','每人到箱子中抽出屬於自己的球拍，猜拳決定發球方後，進行二對二羽毛球比賽，隨時可以更換場上隊員，先得到10分的隊伍就是贏家！','4','2男2女','有黑眼圈x4','穿長襪x3','染頭髮x2'),
	(101,'KeQW2','比手畫腳','派出一個人依照祭司抽出的題目比手畫腳，限時３分鐘，挑戰你們可以猜對幾題吧！','6','穿長襪x5','綁頭髮女生x3+沒瀏海男生x1+有瀏海男生x2','穿NIKE鞋x2+穿ADIDASx2','165公分以下x3'),
	(111,'vNUEM','翻轉地面','所有隊員站在平鋪的垃圾袋上方，盡可能以最快速的方法把垃圾袋翻面，且過程中所有人的腳不可踏出垃圾袋外，違規一次則最終秒數加5秒。完成花費的秒數少即可佔領部落！','4','4女','2女1男','1女2男','2女2男'),
	(121,'5swuv','平衡感王','隊伍６人分開站到指定的位置，並且使用筷子夾住乒乓球的方式接力，將乒乓球從第一人傳至最後一人，在３分鐘內，夾越多顆者獲勝。','6','穿NewBalancex1+臉上有痣x3','穿黑色褲子x3+戴眼鏡x2','臉上有痘痘x3','長頭髮x1+短頭髮x4'),
	(131,'Ao2pa','一路橡吸','小隊排成一列站在指定位置，每人嘴巴咬一隻吸管，以接力的方式把橡皮筋從第一個人傳到最後一個人，過程中不可用手，且橡皮筋中途掉落則需從頭開始。３分鐘內傳遞較多橡皮筋者即可佔領此部落。','8','4男4女','穿牛仔褲x5','有畫眉毛x3','臉上有2顆痣x2+有戴手錶x2'),
	(141,'uIBpt','金雞獨立','所有人用金雞獨立的姿勢站在結界內，想辦法在不用手推擠的狀況下讓敵隊的所有隊員腳落地或跳出結界外即可獲勝！','5','外雙眼皮x2','穿帆布鞋x1+擦唇膏x1','175以上x1','有白頭髮x2'),
	(151,'Ow3vC','甩便利貼','4位隊員分別在身上黏便利貼（額頭一張、雙臂兩張、雙腳兩張、腹部一張、背部一張），限時90秒內甩掉較多便利貼的隊伍即可佔領該據點。','6','穿短褲x2','穿耳洞x2','瀏海在眉毛上x2','鞋子有紅色x2'),
	(161,'iVw1L','喝水唱歌','一次派出一人，到籤筒中抽出一首歌，嘴巴含著水將這首歌唱出來，其他隊員要猜出歌名，猜中後便可換另一位隊員去唱歌。用較少時間猜完6首歌的陣營即可佔領此部落。','8','戴眼鏡x3','拿iphonex2','3男5女','綁雙馬尾x3'),
	(162,'ol7wr','天旋地轉','隊伍中一次派出一人，先抓著智慧之杖轉１０圈，接著運球至前方終點線後，回到隊伍中才可換下一個人出發。全部人完成後遊戲才可結束，花費時間比上一陣營少即可佔領此部落。','6','紮衣服x4','穿高腰褲x3','穿長褲x3','沒鞋帶x2'),
	(171,'YEyKd','灌籃高手','６人輪流投籃，在３分鐘內投進較多籃球的隊伍即可佔領此部落。','6','165以下x4','戴眼鏡x4','拿IPHONEx5','反手可摸到肚臍x2'),
	(181,'DWVw4','乒乓傳情','桌上有5個紙杯，你們必須把乒乓球放在第一個水杯的水面上後，將乒乓球從第一個紙杯吹到最後一個紙杯，第一位隊員吹完後下一位隊員才可以吹第二輪。花較少秒數吹完三輪即可佔領此部落。','3','耳垂連起來x1','有瀏海x3','RDAAx2','紮衣服x3'),
	(191,'soDJ3','Flip-Flop','每人會有一個裝滿水的水杯，須將水杯內的水喝完後，用一根手指將杯口翻至下。前一位隊員喝完水、翻杯子成功後，下一位隊員才可進行遊戲。花費時間比上一陣營少即可佔領此部落。','6','3男3女','SAAx3+AAx2+MAAx1','穿黑襪x2','鞋子有藍色x3'),
	(201,'GJPzb','呼啦抓小雞','同一小隊的隊員搭肩排成縱列，兩隊的排頭手拿呼拉圈，想辦法把呼拉圈套到敵隊的最後一個人身上，率先套中敵隊的隊伍即可獲勝！','5','外雙眼皮x2','穿帆布鞋x1+擦唇膏x1','175以上x1','有白頭髮x2'),
	(211,'lJAfD','頭好撞撞','一隊一回合派出四人上場，用頭進行三回合的排球對戰。先猜拳決定發球方，發球者在線外把球拋起並用頭把球頂到敵方，雙方用頭擊的方式互打，球在敵方落地或是敵方將球擊出界則己方得分．先得七分者拿下該回合勝利。率先獲得兩回合勝利的隊伍即可佔領部落！','12','穿耳洞x4','沒瀏海x6','單眼皮x4','用安卓手機x8'),
	(221,'SZ1yG','打水瓢','一次派出一位隊員挑戰打水瓢，每人有３次機會，連續次數比上一陣營高即可佔領此部落','4','3男1女','170公分以下男生x2','穿全白素Tx2','拳頭可放進嘴巴裡x1'),
	(231,'y997V','巧拼渡河','小隊全體人員站在7片巧拼上，身體不可超出巧拼之外，隊伍最後一人須將最後一塊巧拼傳至隊伍前方，並以此慢慢往前進，直到全員接通過終點線。過程中雙腳都必須站在巧拼上，不可單腳站立也不可透過巧拼滑行前進，違規一次就要被扣一塊巧拼。花費時間比上一陣營少即可佔領此部落。','8','170公分以上x3+155公分以下x2','捲髮女生x3+直髮女生x2','戴手鍊x2+戴手錶x4','單眼皮x3+雙眼皮x3'),
	(241,'X02aw','撲克牌好手','在桌上反蓋的16張撲克牌當中，將所有數字兩兩相同的撲克牌找出來。一次派出一人翻開兩張反蓋的撲克牌，若兩張牌不相同，則需念完指定文章才可以換人並進行下一次翻牌。花較少時間找出所有成對撲克牌者可佔領此部落！','4','1男3女','170公分以上x4','戴眼鏡x4','頭髮過肩x4'),
	(251,'Glsx3','斷開魂結','所有人把手牽起來圍成一個圓，不可牽左右相鄰的人、不可兩手都牽同一個人。確定全部人都將手牽起來後，盡快在手不放開的狀況下把打結的圓解開成為一個圓，秒數少即可佔領部落！','12','6男6女','穿白鞋x5','染頭髮x6','單眼皮x5'),
	(261,'YNbMr','拍拍羽毛球','每人到箱子中抽出屬於自己的球拍，猜拳決定發球方後，進行二對二羽毛球比賽，隨時可以更換場上隊員，先得到10分的隊伍就是贏家！','4','2男2女','有黑眼圈x4','穿長襪x3','染頭髮x2'),
	(271,'KeQW2','比手畫腳','派出一個人依照祭司抽出的題目比手畫腳，限時３分鐘，挑戰你們可以猜對幾題吧！','6','穿長襪x5','綁頭髮女生x3+沒瀏海男生x1+有瀏海男生x2','穿NIKE鞋x2+穿ADIDASx2','165公分以下x3'),
	(281,'vNUEM','翻轉地面','所有隊員站在平鋪的垃圾袋上方，盡可能以最快速的方法把垃圾袋翻面，且過程中所有人的腳不可踏出垃圾袋外，違規一次則最終秒數加5秒。完成花費的秒數少即可佔領部落！','4','4女','2女1男','1女2男','2女2男'),
	(291,'5swuv','平衡感王','隊伍６人分開站到指定的位置，並且使用筷子夾住乒乓球的方式接力，將乒乓球從第一人傳至最後一人，在３分鐘內，夾越多顆者獲勝。','6','穿NewBalancex1+臉上有痣x3','穿黑色褲子x3+戴眼鏡x2','臉上有痘痘x3','長頭髮x1+短頭髮x4'),
	(301,'Ao2pa','一路橡吸','小隊排成一列站在指定位置，每人嘴巴咬一隻吸管，以接力的方式把橡皮筋從第一個人傳到最後一個人，過程中不可用手，且橡皮筋中途掉落則需重來。３分鐘內傳遞較多橡皮筋者即可佔領此部落。','8','4男4女','穿牛仔褲x5','有畫眉毛x3','臉上有2顆痣x2+有戴手錶x2'),
	(311,'uIBpt','金雞獨立','所有人用金雞獨立的姿勢站在結界內，想辦法在不用手推擠的狀況下讓敵隊的所有隊員腳落地或跳出結界外即可獲勝！','5','外雙眼皮x2','穿帆布鞋x1+擦唇膏x1','175以上x1','有白頭髮x2'),
	(321,'Ow3vC','甩便利貼','6位隊員分別在身上黏便利貼（額頭一張、雙臂四張、雙腳四張、腹部三張、背部三張），限時９０秒內甩掉較多便利貼的隊伍即可佔領該據點。','4','穿短褲x5','穿耳洞x3','瀏海在眉毛上x2','鞋子有紅色x2'),
	(331,'iVw1L','喝水唱歌','一次派出一人，到前方清單中選出一首歌，嘴巴含著水將這首歌唱出來，其他隊員要猜出歌名，猜中後便可換另一位隊員去唱歌。用較少時間猜完6首歌的陣營即可佔領此部落','8','戴眼鏡x3','拿iphonex2','3男5女','綁雙馬尾x3'),
	(341,'ol7wr','天旋地轉','隊伍中一次派出一人，先抓著智慧之杖轉１０圈，接著運球至前方終點線後，回到隊伍中才可換下一個人出發。全部人完成後遊戲才可結束，花費時間比上一陣營少即可佔領此部落。','6','紮衣服x4','穿高腰褲x3','穿長褲x3','沒鞋帶x2');
